import React from 'react';
import Icon from '../Icon/index';
import moment from 'moment';

export default class WeatherForecast extends React.Component {
    constructor(props) {
      super(props);
      this.state = { weather: {} };
    }

    render() {
      const weather = this.props.weatherOnDate;
      console.log(weather);

      return (
          <section>
              {moment(weather).format('dddd')}
          </section>
        );
    }  
  }
